import React from "react";
import axios from "axios";

const Hotels=(props)=>{
    const getAtractions=async()=>{
        console.log(props.loc)
        const qs=props.loc['latitude']+"_"+props.loc['longitude']
        const response=await axios.get((`http://localhost:7000/attractions/hotels/${qs}`))
        console.log(response.data)
        return response
    }
    const attractions=getAtractions()
    const display=attractions.map((place)=>{
        return(
            <div className="card">
                <div className="card-image">
                    <img src={place.max_photo_url}></img>

                </div>
            </div>
        )
    })
}
export default Hotels
